import React from 'react'
import { connect } from 'react-redux';


const TaskItem = ({task, index}) =>{

  const style = {
    span:{
      width:'200px',
      padding:0 ,
      listStyleType:'none',
    }
  }

  return(
  <span style={style.span}
        id={task.id}>
        {index+1} {task.title} {task.completed.toLocaleString()}
  </span>
    )
}



export default connect(null, null)(TaskItem);
